import React from "react";

const Header = () => {
  return (
    <div>
      <img src="../Assets/Frame 7.png" />
      <div>
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Skills</li>
          <li>Portfolio</li>
          <li>Contact</li>
        </ul>
      </div>
      {/* button goes here */}
    </div>
  );
};

export default Header;
